function largestPrimeFactor(number) {
  // Good luck!
  const factors=[];
  // generate the factors of number
  for(let i =1; i<= number;i++){
    if(number%i === 0){
       factors.push(i);
    }
  }
  // if we found a number which is divisible by more than 1 or itself
  // remove it from the factors array 
  for(let i =0; i< factors.length;i++){
     for(let j =0;j< factors.length ;j++){
        if(factors[i]%factors[j] ===0 && factors[j] !== 1 && factors[i] !== factors[j]){
          factors.splice(i,1);
          i--;

        }
     }
  }
  // return the last element since the array is sorted
  return factors[factors.length-1];
}

